import React from 'react';
import './Menu.css';

class Menu extends React.Component {
  render() {
    return (
      <div className="menu"> 
        <ul>
            <li>Appetizers</li>
            <li>Soups & Salads</li>
        </ul>
      </div>  
    )
  }
}

export default Menu;
